import React from "react";

const Footer = () => (
  <footer>
    <div>
      Creado por <a href="https://www.facebook.com/profile.php?id=100025641090829">David Sanchez</a>
    </div>
    <div>
      <a href="https://www.instagram.com/viafara_david/">Sigueme en Instagram</a>
    </div>
  </footer>
);

export default Footer;
